webpackJsonp([0x5c6e46084c32],{8617:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Dresden: Tuesday, Feb. 13, 1945 by Frederick Taylor",date:"01 Mar 2004",slug:"/2004-03-01-dresden-tuesday-feb-13-1945-by-frederick-taylor/",tags:"Y2004"},html:'<p><a title="sofa. rites de passage" href="http://arrog.antville.org/stories/709872/">via sofa</a>: <a title="There is the real Dresden and the Dresden of legend..." href="http://www.salon.com/books/review/2004/03/01/dresden/index.html">Salon.com Books "Dresden: Tuesday, Feb. 13, 1945" by Frederick Taylor</a></p>'},next:{fields:{title:"von Beust!",date:"29 Feb 2004",slug:"/2004-02-29-von-beust/"}},previous:{fields:{title:"Et tu, Ole?",date:"01 Mar 2004",slug:"/2004-03-01-et-tu-ole/"}}},{node:{fields:{title:"von Beust!",date:"29 Feb 2004",slug:"/2004-02-29-von-beust/",tags:"Y2004"},html:'<p>The polls are closed in Hamburg, and both <a title="NDR Online: NDR Special - Bürgerschaftswahl 2004 in Hamburg" href="http://www.ndr.de/ndr/regional/hh/wahl/index.html">major</a>  <a title="heute.t-online.de - Prognose: Klarer Sieg für von Beust in Hamburg" href="http://www.heute.t-online.de/ZDFheute/artikel/6/0,1367,HOME-0-2108294,00.html">networks</a> are projecting an absolute majority for Ole von Beust and the CDU. FDP and the two Schill parties have fallen short of 5%. As would be expected, ZDF is predicting a better CDU result (48-42) than is ARD/NDR (46.5-44.5) over SPD/GAL.</p>'},next:{fields:{title:"Subversion",date:"29 Feb 2004",slug:"/2004-02-29-subversion/"}},previous:{fields:{title:"Dresden: Tuesday, Feb. 13, 1945 by Frederick Taylor",date:"01 Mar 2004",slug:"/2004-03-01-dresden-tuesday-feb-13-1945-by-frederick-taylor/"}}},{node:{fields:{title:"Subversion",date:"29 Feb 2004",slug:"/2004-02-29-subversion/",tags:"Y2004"},html:'<p>Pardon me while I dance a jig in the living room. I finally got <a title="a compelling replacement for CVS" href="http://subversion.tigris.org/">subversion</a> working on Solaris 8. It doesn\'t work out of the box, you have to know the proper <a title="subversion dev: Solaris report: svn 0.37 success on sparc solaris 8" href="http://subversion.tigris.org/servlets/ReadMsg?list=dev&msgNo=57624">incantation</a>.</p>\n<p>Of course, you have every right to ask what I am doing working on Solaris at 7 am on Sunday. It\'s because <a title="BBC: \'Napalm\' speech tops movie poll" href="http://news.bbc.co.uk/1/hi/entertainment/film/3362603.stm">I love the smell of napalm in the morning</a>.</p>'},next:{fields:{title:"The Luxury of Ignorance: An Open-Source Horror Story",date:"28 Feb 2004",slug:"/2004-02-28-the-luxury-of-ignorance-an-open-source-horror-story/"}},previous:{fields:{title:"von Beust!",date:"29 Feb 2004",slug:"/2004-02-29-von-beust/"}}}],pathPrefix:"",first:!1,last:!1,index:519,pageCount:1101}}}});
